import React from 'react';
import {Switch, Route} from 'react-router-dom';
import Dashboard from './dashboard/Dashboard'


function Pages() {
    return (
        <Switch>
            <Route path="/dashboard" exact component={Dashboard} />
        </Switch>
    )
}

export default Pages
